import { Route } from "react-router-dom";
import Login from "../Login/Login";


function ProtectedRoute() {
    return<>

    var IsTrue=true;

    if(IsTrue==true){
        <Route path="/Login" component={Login} ></Route>
    }

    </>
}

export default ProtectedRoute;
